import axios from "axios"
import { useEffect, useState } from "react"

export function Teamlist() {
    const [teams, setTeams] = useState([]);

    useEffect(() => {
        axios.get('https://estagio.geopostenergy.com/WorldCup/GetAllTeams',{
            headers: {
                'git-user': 'theoalmeida'
            }
        })
            .then(({data}) => {
                setTeams(data);
            });
            // eslint-disable-next-line react-hooks/exhaustive-deps
    }, [])  
    var lista = []
    for (const pais in teams["Result"]) {
        lista.push(teams["Result"][pais]["Name"])
    };

    var grupoA = [];
    var grupoB = [];
    var grupoC = [];
    var grupoD = [];
    var grupoE = [];
    var grupoF = [];
    var grupoG = [];
    var grupoH = [];

    var x = 0 // variavel de apoio para o sorteio
    while (x < 32) {
        var y = Math.floor(Math.random()*((31-x)- 0 + 1)) + 0  
        if (x <= 3) {
            grupoA.push(lista[y])
            console.log(grupoA, x)
        } else if (x > 3 && x <= 7) {
            grupoB.push(lista[y])
        } else if (x > 7 && x <= 11) {
            grupoC.push(lista[y])
        } else if (x > 11 && x <= 15) {
            grupoD.push(lista[y])
        } else if (x > 15 && x <= 19) {
            grupoE.push(lista[y])
        } else if (x > 19 && x <= 23) {
            grupoF.push(lista[y])
        } else if (x > 20 && x <= 27) {
            grupoG.push(lista[y])
        } else if (x > 27 && x <= 31) {
            grupoH.push(lista[y])
        }
        lista.splice(y, 1)
        x += 1
    }

    return (
        <div>
            <div class="faseDeGrupos">
                <div class="titulo">Grupos sorteados: </div>
                <div class="grupo">
                    Grupo A:
                    <img class="flagPais" src={`../imgs/${grupoA[0]}.png`} />{grupoA[0]}
                    <img class="flagPais" src={`../imgs/${grupoA[1]}.png`} />{grupoA[1]} 
                    <img class="flagPais" src={`../imgs/${grupoA[2]}.png`} />{grupoA[2]} 
                    <img class="flagPais" src={`../imgs/${grupoA[3]}.png`} />{grupoA[3]}
                </div>
                <div class="grupo">
                    Grupo B:
                    <img class="flagPais" src={`../imgs/${grupoB[0]}.png`} />{grupoB[0]}, 
                    <img class="flagPais" src={`../imgs/${grupoB[1]}.png`} />{grupoB[1]}, 
                    <img class="flagPais" src={`../imgs/${grupoB[2]}.png`} />{grupoB[2]}, 
                    <img class="flagPais" src={`../imgs/${grupoB[3]}.png`} />{grupoB[3]}
                </div>
                <div class="grupo">
                    Grupo C:
                    <img class="flagPais" src={`../imgs/${grupoC[0]}.png`} />{grupoC[0]}
                    <img class="flagPais" src={`../imgs/${grupoC[1]}.png`} />{grupoC[1]} 
                    <img class="flagPais" src={`../imgs/${grupoC[2]}.png`} />{grupoC[2]} 
                    <img class="flagPais" src={`../imgs/${grupoC[3]}.png`} />{grupoC[3]}
                </div>
                <div class="grupo">
                    Grupo D:
                    <img class="flagPais" src={`../imgs/${grupoD[0]}.png`} />{grupoD[0]}
                    <img class="flagPais" src={`../imgs/${grupoD[1]}.png`} />{grupoD[1]} 
                    <img class="flagPais" src={`../imgs/${grupoD[2]}.png`} />{grupoD[2]} 
                    <img class="flagPais" src={`../imgs/${grupoD[3]}.png`} />{grupoD[3]}
                </div>
                <div class="grupo">
                    Grupo E:
                    <img class="flagPais" src={`../imgs/${grupoE[0]}.png`} />{grupoE[0]}
                    <img class="flagPais" src={`../imgs/${grupoE[1]}.png`} />{grupoE[1]} 
                    <img class="flagPais" src={`../imgs/${grupoE[2]}.png`} />{grupoE[2]} 
                    <img class="flagPais" src={`../imgs/${grupoE[3]}.png`} />{grupoE[3]}
                </div>
                <div class="grupo">
                    Grupo F:
                    <img class="flagPais" src={`../imgs/${grupoF[0]}.png`} />{grupoF[0]}
                    <img class="flagPais" src={`../imgs/${grupoF[1]}.png`} />{grupoF[1]} 
                    <img class="flagPais" src={`../imgs/${grupoF[2]}.png`} />{grupoF[2]} 
                    <img class="flagPais" src={`../imgs/${grupoF[3]}.png`} />{grupoF[3]}
                </div>
                <div class="grupo">
                    Grupo G:
                    <img class="flagPais" src={`../imgs/${grupoG[0]}.png`} />{grupoG[0]}
                    <img class="flagPais" src={`../imgs/${grupoG[1]}.png`} />{grupoG[1]} 
                    <img class="flagPais" src={`../imgs/${grupoG[2]}.png`} />{grupoG[2]} 
                    <img class="flagPais" src={`../imgs/${grupoG[3]}.png`} />{grupoG[3]}
                </div>
                <div class="grupo">
                    Grupo H:
                    <img class="flagPais" src={`../imgs/${grupoH[0]}.png`} />{grupoH[0]}
                    <img class="flagPais" src={`../imgs/${grupoH[1]}.png`} />{grupoH[1]} 
                    <img class="flagPais" src={`../imgs/${grupoH[2]}.png`} />{grupoH[2]} 
                    <img class="flagPais" src={`../imgs/${grupoH[3]}.png`} />{grupoH[3]}
                </div>
            </div>
            <div>

            </div>
        </div>
    )
}
